import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import AggregationPage from './pages/AggregationPage';
import GraphPage from './pages/GraphPage';


function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route exact path='/' component= {<AggregationPage/>} />
          <Route exact path='/graph' component= {<AggregationPage/>} component={GraphPage} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
